import React from 'react';

class Control_icon extends React.Component {
    render() {
      return (
        <div>
            <i class="fa fa-pencil-alt" data-toggle="modal" data-target="#editModal"></i>
            <i class="fa fa-trash-alt" data-toggle="modal" data-target="#deleteModal"></i>
        </div>
      );
    }
  }
  
  export default Control_icon;
